import React from 'react';
import useSwr from 'swr';
import "./style.css";

const fetcher = (url) => fetch(url).then((res) => res.json())

function Projects(){

const { data, error } = useSwr('/api/projects', fetcher)
if (error) return <div>Failed to load users</div>
if (!data) return <div>Loading...</div>



    return (
        <div className="cardsContainer">
            {[...data].map(project => {
                return (
                    <div key={project.name} className="mobileCards">
                        <h3>{project.name}</h3>
                        <img alt = "Project image" src={project.imgPath} height="25%" width="25%"/>
                        <p>{project.description}</p>
                        <p>Deployed: <a href={project.deployed}>{project.deployed}</a></p>
                        <p>Repo: <a href={project.repo}>{project.repo}</a></p>
                        <p>Technologies: {project.technologies}</p>
                    </div>
                )
            })}
        </div>
    )
}


export default Projects
